import React, { Component } from 'react';
import Navbar from "../navbar/index"
import "./style.css";

class Wrapper extends Component {
    state = {
        theme: {
            darkTheme: {
                elements: "hhsl(209, 23%, 22%)",
                background: "hsl(207, 26%, 17%)",
                text: "hsl(0, 0%, 100%)",
            },
            lightTheme: {
                primary: "cdsv",
                elements: "cac",
                background: "acds",
                text: "dsac"
            }
        }
    }
    render() {
        return (
            <div id="wrapper">
                <Navbar />
            </div>
        );
    }

    darkmode() {
        console.log(this.state.theme.lightTheme)
    }
}

export default Wrapper;
